<pre><code>const usersSchema = new Schema({
    totalProductsViews: {type: Number, default: 0},

    productsViewsStatistics: [{
        day: {type: String, default: new Date().toISOString().slice(0, 10), unique: true},
        count: {type: Number, default: 0}
    }],
});
</code></pre>

<p>So today views will be stored in another subdocument different from yesterday. To implement this I tried to use <a href="https://mongoosejs.com/docs/api.html#model_Model.findByIdAndUpdate" rel="nofollow noreferrer">upsert</a> so as subdocument will be created each day when product is viewed and counts will be incremented and recorded based on a particular day. I tried to use the following function but seems not to work the way I intended.</p>

<pre><code>usersSchema.statics.increaseProductsViews = async function (id) {
    //Based on day only.
    const todayDate = new Date().toISOString().slice(0, 10);

    const result = await this.findByIdAndUpdate(id, {
            $inc: {
                totalProductsViews: 1,
                'productsViewsStatistics.$[sub].count': 1
            },
        },
        {
            upsert: true,
            arrayFilters: [{'sub.day': todayDate}],
            new: true
        });
    console.log(result);
    return result;
};
</code></pre>

<p>What do I miss to get the functionality I want? Any help will be appreciated.</p>

