<pre><code>{ "_id" : ObjectId("5c8fa906cd5591004c2db5f9"), "id" : 49893861, "cate_id" : "81614" }
{ "_id" : ObjectId("5c8fa906cd5591004c2db602"), "id" : 49893861, "cate_id" : "1102" }
{ "_id" : ObjectId("5c8fa906cd5591004c2db606"), "id" : 49893861, "cate_id" : "1102" }
</code></pre>

<p>The desired result should be:</p>

<pre><code>{
  "id": 49893861,
  "categories": [
    {
      "cate_id": "1102",
      "count": 2
    },
    {
      "cate_id": "81614",
      "count": 1
    },
  ]
}
</code></pre>

<p>I am wondering how to achieve this using the correct MongoDB aggregation framework command. Thank you!</p>

