Sort on two fields in MongoDB simultaneously<p>I am currently developing a solution in MongoDB, where i have two different data schemas in the same collection. The problem is that some of the data has different field names. For example:
In one of the contracts a date is named: <code>date_at</code>, but in another type of contract it is just named <code>date</code>.</p>

<p>So the question is: <strong>How do i sort on one field, and if it is not present in the document, sort on the other instead?</strong></p>

<p>Currently i am trying to make a query such as this:</p>

<pre class="lang-js prettyprint-override"><code>db.collection('contracts').aggregate([
  {$project: {
    date_at: [ $ifNull: ['$date', null]
  }},
  {$sort: { date_at: -1 }}
]);
</code></pre>

<p>But it doesn't seem to work. Hopefully one of you will be able to help me. Thank you in advance.</p>

