Summing Values From a Document<p>In MongoDB 4 I am working with a collection that contains a document-of-documents that contains numbers. I want to sum all those numbers. </p>

<p>Query which right now just spits out the full document:</p>

<pre><code>db.metadata.aggregate([  
   {  
      $match:{  
         "download-md5-checksum":"419f21233097c5f7bcd937a2c94b8032"
      }
   },
   {  
      $group:{  
         _id:"$xled.xled-bad-counts",
         count:{  
            $sum:1
         }
      }
   },
   {  
      $project:{  
         "xled.xled-bad-counts":"$_id",
         count:1,
         _id:0
      }
   }
]).pretty()
</code></pre>

<hr>

<pre><code>{
    "count" : 1,
    "xled" : {
        "xled-bad-counts" : {
            "left-engine-accessory-gearbox-count" : 7,
            "left-engine-accessory-gearbox-minimum" : 2,
            "left-engine-accessory-gearbox-maximum" : 2,
            "left-engine-accessory-gearbox-total" : 3
        }
    }
}
</code></pre>

<p>I know about the <code>$sum</code> function but I believe it wants to act on an array, however my data is arranged as a document of documents.</p>

<p>How can I use MongoDB shell commands to properly aggregate this and perform a summation? I'd like my output to just be</p>

<p><code>{count: 453}</code></p>

