Exception "waiting for replication timed out" received for MongoDB Bulk Write operation<p>We have two servers for MongoDB servers, one is primary, the other is configured as replica. </p>

<p>We use PHP to bulk write a list of updates to MongoDB. From the server logs, we do some a small amount of exceptions of "waiting for replication timed out" in our server logs. </p>

<ol>
<li>What could be the reason of the exception? The network between two servers are stable. </li>
<li>When we receive the exception "waiting for replication timed out", we can assume the Bulk Write operation has successfully updated the target documents to the primary server?  </li>
</ol>

<p>The bulk write part of the PHP codes: </p>

<pre><code> try {
            $manager = new MongoDB\Driver\Manager("mongodb://" . DB_HOST);
            $writeConcern = new MongoDB\Driver\WriteConcern(MongoDB\Driver\WriteConcern::MAJORITY, 10000);
            $result = $manager-&gt;executeBulkWrite($DBName . '.' . $collection, $bulk, $writeConcern);
            return $result;
        } catch (Exception $ee) {
            AppendToLogFile(ERROR_Internal_Error, 'Script:' . __FILE__ . ', LINE:' . __LINE__ . ',$ee:' . $ee-&gt;getMessage());
            continue;
        }
</code></pre>

<p>Thanks!</p>

