embedfield:
CosmosDb Request rate is large with insertMany<p>I have the following repository class inserting data in a CosmosDb database from a batch : </p>

<pre><code>public bool InsertZonierData(List&lt;Zonier&gt; zonierList)
{
    if (zonierList == null || !zonierList.Any())
    {
        throw new ZonierListNullOrEmptyException();
    }
    else
    {
        try
        {
            _collection.InsertMany(zonierList);
            return true;
        }
        catch (MongoBulkWriteException ex)
        {
            throw new DataBaseWritingException(ex.Message, ExceptionCodeConstants.DataBaseWritingExceptionCode);
        }
    }
}
</code></pre>

<p>Unfortunately, having more than 30000 elements in the <code>zonierList</code>, it throw the following exception on CosmosDb : </p>

<blockquote>
  <p>Unhandled Exception: MongoDB.Driver.MongoCommandException: Command insert failed: Message: {"Errors":["Request rate is large"]}</p>
</blockquote>

<p>Following the documentation, it is an issue related to RU / sec on Cosmos. Of course an easy way would be to increase it, but that's not what I want to do.</p>

<p>Is there an easy and clear way to refactor the method allowing us to insert data without breaking the 400 RU / sec from CosmosDb.</p>

